I don't even know what to say about this one...a cultural institution created by @malcolmdlee and executed by the likes of a cast that goes back 20 years in @iamnialong @haroldperrineau @morereginahall @1melissadesousa @therealterrancehoward @tayediggsinsta @sanaalathan @morrischestnutofficial and the producers @dtelson31 @daynalynnenorth 🌟🌟🌟

How do you honor Black Excellence like this?? To be able to take what is given and shine light on it like the majors? We do that cus we are the majors!!! 

Don't play with us!! We are the Black Excellence platform that you seek to reach. We understand you and the "Candy" Electric Slide more than any of the other platforms that you seek promo from...and while we might not get the same access or time or notoriety as the mainstream...we are still here to champion your push to get our culture to the masses.

We love yall as a story and a crew and understand that this journey of 20 some odd years of storytelling isn't easy...but is meaningful. 

Thank you @peacocktv and @myabriabe and @amber.corrine and team @vibemagazine for making this happen.
Now go read the story and watch the episodes damn it!!😭🤣👑💥🌟

